import React from 'react'
import './AboutMe.css'
function AboutMe() {
    return (
          
        <div className = 'about-me'>
            <h2 className='h2-style'>About Me</h2>
            <p className = 'text-style'>
                Hello! My name is Brandon i'm a software developer looking for opportunities to showcase my skills, 
                feel free to look at my projects and send me an email using the in-site form.
            
             </p>
            
        </div>
    )
}

export default AboutMe;
